package com.example.asm_java_nangcao1.Model;public class Contact {    String namePhone;    String numberPhone;    public Contact(String namePhone, String numberPhone) {        this.namePhone = namePhone;        this.numberPhone = numberPhone;    }    public String getNamePhone() {        return namePhone;    }    public void setNamePhone(String namePhone) {        this.namePhone = namePhone;    }    public String getNumberPhone() {        return numberPhone;    }    public void setNumberPhone(String numberPhone) {        this.numberPhone = numberPhone;    }}